import { useState } from 'react';
import Header from '../Components/Header';
import Navbar from '../Components/Navbar';
import '../style/taxes.css'

function Taxes() {
  const [checkboxController, setCheckboxController] = useState({ pending: true, payed: true });

  const handleFilter = ({ target }) => {
    // console.log(target)
    setCheckboxController((prev) => {
      // console.log('antes de mudar', prev);
      prev[target.name] = !prev[target.name];
      // console.log('depois de mudar', prev);
      return prev;
    });
  };

  return (
    <div className="container">
      <Header />
      <div className='content'>
        <Navbar />
        <div className='main-content'>
          <form>
            <h2>Filtros:</h2>
            <label htmlFor="pending">
            Pendentes
            {console.log('pendente', checkboxController.pending)}
              <input
                type="checkbox"
                checked={checkboxController.pending}
                onChange = { handleFilter }
                name='pending'
                id='pending'
              />
            </label>
            <label htmlFor="payed">
              Pagos
              {console.log('pagos', checkboxController.payed)}
              <input
                type="checkbox"
                checked={checkboxController.payed}
                onChange = { handleFilter }
                name='payed'
                id='payed'
              />
            </label>
          </form>
          <div className='taxes-list'>

          </div>
        </div>
      </div>
    </div>
  )
};

export default Taxes;
